window.bookSummaryJSON = "<p>With his wedding behind him, Fred is looking forward to nightly life finally settling down. Unfortunately, someone from his past has other, far less peaceful, plans in mind.</p> <p>Finding his clan under attack, Fred must scramble to discover who is working against him and how to fight back. Between securing shelter, trading favors, and keeping up with his accounting business, it wonâ€™t be easy to stay out of trouble; let alone uncover the identity of his adversary.</p> <p>Faced with an enemy who has no interest in diplomacy, Fred and his friends will have to make hard choices if they want to survive. Choices that could forever change The House of Fred.</p> <p>Performed by Christopher Walker, Steven Carpenter, Zeke Alton, Eva Wilhelm, Carolyn Kashner, Marni Penning, Scott McCormick, Joe Mallon, Ken Jackson, Shanta Parasuraman, Matthew Schleigh, Gabriel Michael, Anthony Palmini, Bill Gillett, Chris Davenport, Richard Rohan, Bradley Foster Smith, Peter Holdway, Nora Achrati, Yasmin Tuazon, Torian Brackett, Nicole Perez, Andrew Mimms, Jessica Lauren Ball, Karen Novack, Nazia Chaudhry, Steve Wannall, Holly Adams, Terence Aselford, Ryan Carlo Dalusung, Nanette Savard, Lise Bruneau, Eric Messner, Colleen Delany, Danny Gavigan and Alejandro Ruiz.</p>"; 
